import Foundation

struct SiteRequestModel: Encodable{
    let site: String = "stackoverflow"
    let page: Int
}

struct SiteResponseModel: Decodable {
    let items: [Item]?
}

struct Item: Decodable {
    let title: String?
    let content_license: String?
}

struct SiteRequest: Request {
    typealias ReturnType = SiteResponseModel
    var path: String = APPURL.SITEURL
    var queryParams: Parameters?
    var method: HTTPMethod = .get
    init(params: Parameters) {
        self.queryParams = params
    }
}

